import React from 'react' ;
import './Contact.css' ;

function Contact()  {

    return(
      <div className="contact-us">
        
         
         <textarea name="message" rows="10" cols="30">
              Enter your message
           </textarea>
      
          
      </div>
     
    );
}
  
  export default Contact ;
